import React from "react"

function auth() {
    var email = $("#ed_email").val()
    var password = $("#ed_password").val()
    var name = $("ed_name").val()
    var date = $("ed_bornDate").val()

    const url = new URL(window.location.href)
          param = new URLSearchParams(url.searchParams)
    event.preventDefault()
    $.ajax({
        url: "http://localhost:3000/registration",
        type: "post",
        dataType: "json",
        contentType: "application/x-www-form-urlencoded",
        data: {
            "name" : name,
            "email" : email,
            "password" : password,
            "bornDate" : date
        }
    })
}


export default() =>
<main>
<div style={{display: "grid", background: "white"}}>
<img src="static/src/Logo_petro.png" id="logo_petro"/>
    </div>
    <form method = "post">
    <input
      type = "name"
      name = "name"
      id = "ed_name"
      placeholder = "Name"/>

    <input
      type = "email"
      name = "email"
      id = "ed_email"
      placeholder = "Email"/>

    <input
      type = "password"
      name = "password"
      id = "ed_password"
      placeholder = "Password"/>

    <input
      type = "date"
      name = "bornDate"
      id = "ed_bornDate"
      placeholder = "Birth Date"/>

    <select className="gender">
        <option value="Male">Male</option>
        <option value="Female">Female</option>
    </select>

      <button className="register">Register<a href = '/Login'></a></button>

      <div className="back"><a href='/Login' className="ahref">Back to Login</a></div>
    </form>


<style jsx global>{`
